const {Router} = require('express');
const stream = require('stream');
const pdfgen = require('html-pdf');
const routes = Router();

const htmlTemplate = `
<!DOCTYPE html>
<html lang="pt-br">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Cart√£o do SUS</title>

    <style>
      * {
        margin: 0px;
        padding: 0px;
        box-sizing: border-box;
        font-family: "Courier New", Courier, monospace;
      }

      .row {
        margin-bottom: 30px;
      }

      .container {
        margin: 0 auto;
        width: 620px;
        display: flex;
        position: relative;
        font-weight: bold;
      }

      .card-image {
        width: 620px;
      }

      .box-data {
        background-color: #fff;
        width: 225px;
        height: 110px;
        position: absolute;
        top: 54px;
        right: 43px;
        padding: 10px;
      }

      section.text {
        font-size: 10px;
      }

      div.double-info {
        display: flex;
        font-size: 9.1px;
      }

      .birth-label {
        letter-spacing: 0.1px;
        width: 150px;
      }

      .birth-value {
        display: inline-block;
        margin-left: 2.5px;
        letter-spacing: 0.1px;
      }

      span.name {
        display: block;
        height: 25px;
        text-transform: uppercase;
      }

      .barcode .number {
        font-size: 18.97px;
        display: block;
      }

      .barcode img {
        width: 204px;
        height: 30px;
      }
    </style>
  </head>
  <body>
    <div class="row">
      <div class="container">
        <img src="data:image/jpeg;base64," class="card-image" />
        <div class="box-data">
          <section class="text">
            <span class="name">FELLYP KARLON DOS SANTOS PANTOJA</span>
            <div class="double-info">
              <table>
                <td width="145">Data Nasc.: <span class="birth-value">10/07/1995</span></td>
                <td>Sexo: M</td>
              </table>
            </div>
          </section>
          <section class="barcode">
            <span class="number">898 0041 1234 9876</span>
            <img src="" />
          </section>
        </div>
      </div>
    </div>
  </body>
</html>
`;

routes.get('/generatePDF', (request, response) => {
  // pdfgen
  //   .create('<div id="pageHeader">Default header</div>')
  //   .toFile('./demo.pdf', (err, res) => {
  //     if (err) return console.log(err);
  //     console.log(res);
  //   })
  pdfgen
    .create(htmlTemplate)
    .toBuffer((err, buffer) => {
      const fileContents = Buffer.from(buffer, 'binary');
      const readStream = new stream.PassThrough();
      readStream.end(fileContents);

      response.set('Content-disposition', 'attachment; filename=' + `${new Date().getTime()}.pdf`);
      response.set('Content-Type', 'application/pdf');

      readStream.pipe(response);
    })

  // response.json({ file: 'name.pdf' });
})

module.exports = routes;